import { useState } from "react";

export default function InputFormComponent() {
    
    function submitDetails() {
        alert("User Name is: ")
        alert("User Age is: ")
        alert("User Designation is: ")
        alert("User Salary is: ")
        alert("User User Bonus is: ")
    }

    return (
        <div>
            <b style={{width: "300px", display:"inline-block"}}>Please Enter Name</b><input type="text" /><br/><br/>
            <b style={{width: "300px", display:"inline-block"}}>Please Enter Age</b><input type="text" /><br/><br/>
            <b style={{width: "300px", display:"inline-block"}}>Please Enter Designation</b><input type="text" /><br/><br/>
            <b style={{width: "300px", display:"inline-block"}}>Please Enter Salary</b><input type="text" /><br/><br/>
            <b style={{width: "300px", display:"inline-block"}}>Please Enter Bonus</b><input type="text" /><br /><br />
            
            <input type="button" onClick={submitDetails} value="Save to Database" />
        </div>
    )

}
